import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { getId } from '../modules/notice'
const NoticeContainers = ({getId}) => {

    const data = useSelector(state => state.notice.data);
    const dispatch = useDispatch();
    const OnIncrease = useCallback(() => dispatch(addCount()), [dispatch]);

    const getData = useSelector(state => state.notice.data)

    return (
        <>
            <div>
                {getData && getData.map(list => (
                    <>
                        <List props={list} key={list.NTC_ID} Onchange={{getId}}></List>
                    </>
                ))}
            </div>
        </>
    )

}

export default NoticeContainers;
